    height: "100%",
    textAlign: "justify",
    marginTop: 16,
  },
}));

const BetActionBar = ({}) => {
  const classes = useStyles();
  return (
    <CardActions disableSpacing>
      <Button size="lg" color="primary"></Button>
      <Button size="lg" color="primary"></Button>
      <Button size="lg" color="primary"></Button>
    </CardActions>
  );
};

